        <Article>
          <Img src={introSec1} alt="sec1" />
          <Section>sec1</Section>
        </Article>

        <Article>
          <Img src={introSec1} alt="sec1" />
          <Section>sec2</Section>
        </Article>

        <Article>
          <Img src={introSec1} alt="sec1" />
          <Section>sec3</Section>
        </Article>

        <Article>
          <Img src={introSec1} alt="sec1" />
          <Section>sec4</Section>
        </Article>
      </Div>
    </>
